import React from 'react';
import '../../../../Header.css'
import {CartItems} from '../CartItems/CartItems';
import cross from '../../../../../../img/times-solid.svg';
import pizza1  from  '../../../../../../img/pizza1.png'

class CartTotal extends React.Component{

    render(){
        return <nav className="carttotal">
                    <h3>Cart Totals</h3>
                    <hr/>
                    <ul className="carttotal--pizza">
                        {CartItems.map((item, index) => {
                            return (
                                <li key={index} className="item.cName">
                                   <a><h6>{item.title}</h6></a>
                                </li>
                            )
                        })}
                    </ul>
                    <ul>
                        <li>
                        <a><img src={cross} alt="cross"/></a>
                        <img src={pizza1} alt="pizza item1"/>
                        <div>
                            <h4>Moorish Lamb</h4>
                            <p><span>SIZE:</span> Large</p>
                            <p><span>1x</span> $19.00</p>
                        </div>
                        </li>
                    </ul>
               </nav>     
    } 
}

export default CartTotal;
